const SEND_MESSAGE = "SEND_MESSAGE";
const UPDATE_MESSAGE = "UPDATE-MESSAGE";

let initialState = {
  dialogs: [
    {
      id: 1,
      name: "Val",
      ava:
        "data:image/png;base64,",
    },
    {
      id: 2,
      name: "Roman",
      ava:
        "data:image/png;base64,",
    },
    {
      id: 3,
      name: "Nik",
      ava:
        "data:image/png;base64,",
    },
    {
      id: 4,
      name: "Maria",
      ava:
        "https://i.pinimg.com/originals/4d/be/f2/4dbef203bdbb796f95cd3b395d263f09.jpg",
    },

    {
      id: 5,
      name: "Oksana",
      ava:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSZdH4kcHCeAQE00YGCQuzt1UvcpwymmNybew&usqp=CAU",
    },
  ],
  messages: [
    { id: 1, message: "Hello, how're you" },
    { id: 2, message: "Need to meet ASAP" },
  ],
  newMessageText: "",
};

const dialogsReducer = (state = initialState, action) => {
  switch (action.type) {
    case SEND_MESSAGE:
      let newMessage = {
        id: 3,
        message: state.newMessageText,
      };
      return {
        ...state,
        messages: [...state.messages, newMessage],
        newMessageText: "",
      };

    case UPDATE_MESSAGE:
      return {
        ...state,
        newMessageText: action.newText,
      };

    default:
      return state;
  }
};

export const sendMessageAC = () => ({ type: SEND_MESSAGE });
export const updateMessageAC = (text) => ({
  type: UPDATE_MESSAGE,
  newText: text,
});
export default dialogsReducer;
